import './App.css';
import ClientCrud from '../components/clients/ClientCrud'
import { BrowserRouter } from 'react-router-dom'

function App() {
  return (
    <div className="j">
      <BrowserRouter>
        <div className='app'>
          <Routes>
            <Route exact path="/" element={ClientCrud}/>
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
